This is the exciting sequel to Disney's The Emperor's New Groove!

Get back in the groove with Disney's hilarious all-new movie. After his wild adventures with Pacha and Emperor Kuzco, lovable lug Kronk, Yzma's former henchman, has happily started a new life as the head chef in his very own diner. An all-new, wacky adventure begins, however, when a llama-gram arrives telling him that his father is due for a visit. Before you can say &quot;squeaker, squeak&quot;, Kronk is cooking up trouble with the sly enchantress, Yzma, trying to make himself look like a success in time for Papi's arrival. After a bunch of big blunders and a massive cheese explosion in the restaurant, Kronk finds himself covered in a heap of trouble. It is only with the help of friends both old and new that Kronk learns to be true to his groove...
